package main

import "fmt"

func zeroGoal(nums []int) int {
	// Counting all subarrays that have only 0s.
	cnt := 0

	for left := 0; left < len(nums); left++ {
		for j := left; j < len(nums) && nums[j] == 0; j++ {
			cnt++
		}
	}

	return cnt
}

func numSubarrayWithSum(nums []int, goal int) int {
	if goal == 0 {
		return zeroGoal(nums)
	}

	cnt, lenNums := 0, len(nums)

	for left := 0; left < lenNums; left++ {
		sum := 0

		for right := left; right < lenNums && sum <= goal; right++ {
			sum += nums[right]

			if sum == goal {
				cnt++
			}
		}
	}

	return cnt
}

// AT MOST APPROACH
// atMost(goal) - atMost(goal - 1) => removes the subarrays that have their sum < goal
func atMost(nums []int, goal int) int {
	left, right, sum, cnt := 0, 0, 0, 0

	for right < len(nums) {
		sum += nums[right]

		for sum > goal && left <= right {
			sum -= nums[left]
			left++
		}

		cnt += right - left + 1
		right++
	}

	return cnt
}

func nSWS(nums []int, goal int) int {
	if goal == 0 {
		return zeroGoal(nums)
	}

	return atMost(nums, goal) - atMost(nums, goal-1)
}

